taskSetItem.script1:
var e1 = ee.getEditText(ee.getControl("edit1"));
//var e2 = ee.getEditText(ee.getControl("edit7"));
//发送
eio.appendInt32(g5.pageSize);
eio.appendInt32(g5.pageCurrent);
eio.appendString16(e1);
if (ee.getControl("panel3").chk) {
    eio.appendInt32(1);
} else {
    eio.appendInt32(0);
}  
if (ee.getControl("panel10").chk) {
    eio.appendInt32(1);
} else {
    eio.appendInt32(0);
}
if (ee.getControl("panel12").chk) {
    eio.appendInt32(1);
} else {
    eio.appendInt32(0);
}
//eio.appendString16(e2);

taskSetItem.script2:
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();
var e1 = eio.readString16();
var e2 = eio.readInt32(); 
var e3 = eio.readInt32();
var e4 = eio.readInt32();
//产生条件语句 where accountName='" + db.encode(session.get("username")) + "'
var condition = "";
if (e1!="") {
    condition += " and concat(cardBill.cardUserName,userInfo.mobile,userInfo.nickName,userInfo.idName,cardBill.cardNumber,carBill.note,cardBill.bankName) like '%" + db.encode(e1) + "%'";
}
if (e2!=0) {
    condition += " and cardBill.dealType = '提现成功'";
}
if (e3!=0) {
    condition += " and cardBill.dealType = '提现'";
}
if (e4!=0) {
    condition += " and cardBill.dealType = '提现失败'";
}
var sql, sqlResult;

//获取记录数量
sql = "select count(*) as c from cardBill INNER JOIN userInfo ON cardBill.userId = userInfo.id " + condition; 
es.logWarning(sql); 
sqlResult = db.executeQuery("PJ", sql);
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");
//读取表
sql =
    "SELECT cardBill.id,cardBill.userId,cardBill.regDatetime ,userInfo.mobile ,userInfo.nickName,userInfo.idName, "+
    "cardBill.cardNumber, cardBill.cardUserName, cardBill.dealType, "+
    "cast(cardBill.money as decimal(18,2)) as m,cardBill.bankName,cardBill.note "+
    "FROM cardBill INNER JOIN userInfo ON cardBill.userId = userInfo.id" +
    condition + " order by regDatetime desc ";
es.logWarning(sql);                  
sqlResult = db.executeQuery("PJ", sql);
eio.appendInt32(count);
eio.appendDataSet(sqlResult, "id,regDatetime,nickName,idName,mobile,cardUserName,cardNumber,bankName,dealType,m,note", pageSize*(pageCurrent-1), pageSize);

taskSetItem.script3:
g5.pageRecordCount = eio.readInt32();
g5.dataset1 = eio.readDataSet();
g5.pageCount = parseInt((g5.pageRecordCount-1)/g5.pageSize)+1;
ee.setTableData(ee.getControl("tablebody1"), g5.dataset1, 0);
ee.setText(ee.getControl("layoutxitem8"), g5.pageCurrent + "/" + g5.pageCount);

